import { Grid, Paper } from '@mui/material'
import React from 'react'
// The responsive layout grid adapts to screen size and orientation, ensuring consistency across layouts.
// mui Grid uses CSS flexbox not grid, we can control only coulmn width using size props
// Column widths are integer values between 1 and 12. For example, an item with size={6} occupies 
//  half of the grid container's width. size={12}, item occupies full width of container
const Gridpractice = () => {
  return (
    <div>
      <Grid container spacing={2}>
        {/* spacing is to add space between grid items */}
        <Grid size={3} sx={{height:'300px'}} >
            {/* for column width we can use size and for row  height we can use height */}
            {/* occupies 1/4th of container */}
            <Paper elevation={6}>
                <img src="data:image/jpeg;base64," alt="" />
            </Paper>
        </Grid>
        <Grid size={{xs : 12,sm:9,lg:12}}>
            {/* breakpoints used to make the grid responsive, xs,s--for mobile screen md--tab screen lg--laptop xl--large moniter,tv.. */}
            <Paper elevation={6}>
                <img src="data:image/jpeg;base64," alt="" />

            </Paper>
        </Grid>
        <Grid size={{xs : 12,sm:9,lg:12}}>
            <Paper elevation={6}>
                <img src="data:image/jpeg;base64," alt="" />

            </Paper>
        </Grid>
        
        
      </Grid>
    </div>
  )
}

export default Gridpractice
